-- ----------------------------
-- View structure for v_stock_balance
-- ----------------------------
DROP VIEW IF EXISTS `v_stock_balance`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `v_stock_balance` AS select `tsi`.`drug_id` AS `drug_id`,`tsi`.`batch_number` AS `batch_number`,`tsi`.`expiry_date` AS `expiry_date`,`ts`.`facility_id` AS `facility_id`,`tsi`.`balance_after` AS `balance`,`tsi`.`created_at` AS `last_update`,`ts`.`store_id` AS `store_id`,`tsi`.`unit_cost` AS `unit_cost` from (`v_reodered_stock_items` `tsi` join `tbl_stock` `ts`) where (`ts`.`id` = `tsi`.`stock_id`) group by `tsi`.`batch_number` order by `tsi`.`expiry_date` desc ;
